import React from "react";
import Col from "react-bootstrap/Col";
import Raw from "react-bootstrap/Row";
import Card from 'react-bootstrap/Card';

const Price = (props) => {
  return (
    <Raw>
      <Col xs={6} md={4}>
        <Card
          bg="Light"
          key="Light"
          text="Light"
          style={{ width: '18rem' }}
          className="mb-2"
        >
          <Card.Body>
            <Card.Title>$ 2,000.00</Card.Title>
          </Card.Body>
        </Card>
      </Col>
      <Col xs={6} md={4}>
        xs=6 md=4
      </Col>
      <Col xs={6} md={4}>
        xs=6 md=4
      </Col>
    </Raw>
  );
};

export default Price;
